[{'comment_id': 1261258734, 'comment_body': 'Can you store the component information in a more easy to query manner. You could either have two metadata, `CompoundComponent` and `CompoundCoefficients` or have `CompoundComponent` return a vector of pairs of the form `[A => 3, B => 1, C => 2]` for A3BC2?', 'comment_created': datetime.datetime(2023, 7, 12, 14, 22, 47, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}, {'comment_id': 1261261268, 'comment_body': 'Does this support interpolation of previously defined species? i.e.
```julia
@variables t
@species A(t) B(t)
@compound A2B3 2*($A) 3*($B)
```
to use the existing A and B symbolic variables instead of creating new ones? The reason to support this is that there may be extra metadata attached to predefined species we want to preserve and keep in the compound.
```', 'comment_created': datetime.datetime(2023, 7, 12, 14, 24, 36, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}, {'comment_id': 1261263370, 'comment_body': "You should test equality of the numeric coefficients and the symbolic variables separately. For symbolic variables you can use `isequal(A,B)` to test if they are the same symbolic. You shouldn't ever be converting to strings when working with symbolic variables except for display reasons.", 'comment_created': datetime.datetime(2023, 7, 12, 14, 26, 4, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}, {'comment_id': 1261269946, 'comment_body': 'Add a dispatch if `s` is a `Num` that unwraps?', 'comment_created': datetime.datetime(2023, 7, 12, 14, 30, 46, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}, {'comment_id': 1261640059, 'comment_body': '@TorkelE and I spoke, and I think we prefer the approach of storing the symbolic components and their coefficients separately. ', 'comment_created': datetime.datetime(2023, 7, 12, 19, 29, 13, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}, {'comment_id': 1261992241, 'comment_body': 'Okay, will implement this in the next commit.', 'comment_created': datetime.datetime(2023, 7, 13, 5, 11, 50, tzinfo=datetime.timezone.utc), 'commenter': 'LalitChauhan56', 'type': 'User'}, {'comment_id': 1261994157, 'comment_body': 'Before defining a compound the constituent species must be explicitly declared. The `@compound` macro only creates a single new species which is the compound itself. So if I use a previously declared species with the macro, it is not created again and so the metadata is preserved. 

So in this case, any metadata previously attached to species `A` or `B` will be accessible even after it has been used with the `@compound` macro. ', 'comment_created': datetime.datetime(2023, 7, 13, 5, 15, 25, tzinfo=datetime.timezone.utc), 'commenter': 'LalitChauhan56', 'type': 'User'}, {'comment_id': 1264704726, 'comment_body': 'Does it work if `s = 2 C?`', 'comment_created': datetime.datetime(2023, 7, 16, 15, 46, 7, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}, {'comment_id': 1264704986, 'comment_body': "I'd prefer if these didn't allocate, and instead just returned an existing array.

Did you try looking at how the `@reaction_network` macro works? It calls code that can separate expressions to give the numerical coefficients. Maybe you can reuse that code / approach to split expressions within the macro instead of doing it in these function calls?", 'comment_created': datetime.datetime(2023, 7, 16, 15, 47, 59, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}, {'comment_id': 1264705251, 'comment_body': 'Likewise can one use an existing parameter or variable as a coefficient, i.e.
```julia
@variables t a(t)
