@species A(t) B(t)
c = 3*b
@compound AaB6 = a*A 2*c
```', 'comment_created': datetime.datetime(2023, 7, 16, 15, 49, 59, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}, {'comment_id': 1275543033, 'comment_body': 'Remove it from the extras if you are adding it to the main deps.', 'comment_created': datetime.datetime(2023, 7, 26, 22, 28, 32, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}, {'comment_id': 1275543153, 'comment_body': "This file shouldn't be checked in.", 'comment_created': datetime.datetime(2023, 7, 26, 22, 28, 47, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}, {'comment_id': 1275543443, 'comment_body': 'What is this file and modifications?', 'comment_created': datetime.datetime(2023, 7, 26, 22, 29, 22, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}, {'comment_id': 1275543550, 'comment_body': 'Why is this file being updated?', 'comment_created': datetime.datetime(2023, 7, 26, 22, 29, 35, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}, {'comment_id': 1275544618, 'comment_body': 'You should never solve Ax = b via taking the inverse. You should use a linear system solver, in this case we probably want one that works in integer arithmetic to avoid rounding. Take a look at what we do to calculate nullspaces in Catalyst, and at the code in:

https://github.com/SciML/ModelingToolkit.jl/blob/master/src/structural_transformation/bareiss.jl

which is designed to do row reduction while preserving integer matrices.', 'comment_created': datetime.datetime(2023, 7, 26, 22, 31, 36, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}, {'comment_id': 1275544951, 'comment_body': 'Use an integer algorithm to remove the need for this.', 'comment_created': datetime.datetime(2023, 7, 26, 22, 32, 11, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}, {'comment_id': 1275547075, 'comment_body': 'https://gregorygundersen.com/blog/2020/12/09/matrix-inversion/', 'comment_created': datetime.datetime(2023, 7, 26, 22, 36, 27, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}, {'comment_id': 1276488095, 'comment_body': "Sorry, used my old PC for this commit and it messed up some files because it wasn't up-to-date with the repository. Will fix it in the next commit.", 'comment_created': datetime.datetime(2023, 7, 27, 15, 49, 46, tzinfo=datetime.timezone.utc), 'commenter': 'LalitChauhan56', 'type': 'User'}, {'comment_id': 1276488903, 'comment_body': 'Understood! Thank you for the information.', 'comment_created': datetime.datetime(2023, 7, 27, 15, 50, 28, tzinfo=datetime.timezone.utc), 'commenter': 'LalitChauhan56', 'type': 'User'}, {'comment_id': 1282155067, 'comment_body': "You are exporting non-existent functions here? (i.e. `balance` and `get_stoich`?) Also, let's not export `component_coefficients`.", 'comment_created': datetime.datetime(2023, 8, 2, 16, 29, 15, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}, {'comment_id': 1282157211, 'comment_body': 'What are these commented lines about?', 'comment_created': datetime.datetime(2023, 8, 2, 16, 30, 18, tzinfo=datetime.timezone.utc), 'commenter': 'isaacsas', 'type': 'User'}]
